	private PartnerHasFingerPrint createPartnerHasFingerPrint(Partner partner,
			FingerPrint fingerPrint) {
		PartnerHasFingerPrint partnerHasFingerPrint = new PartnerHasFingerPrint();
		partnerHasFingerPrint.setPartner(partner);
		partnerHasFingerPrint.setFingerPrint(fingerPrint);
		partnerHasFingerPrint.setStatus(1);
		return partnerHasFingerPrint;
	}

